import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <NavLink className="navbar-brand" to="/">Real Estate SPA</NavLink>
        <button 
          className="navbar-toggler" 
          type="button" 
          data-toggle="collapse"    // Change from data-bs-toggle to data-toggle
          data-target="#navbarNav" 
          aria-controls="navbarNav" 
          aria-expanded="false" 
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
        <NavLink className="nav-link" activeClassName="active" exact="true" to="/">Home</NavLink>
<NavLink className="nav-link" activeClassName="active" exact="true" to="/about">About</NavLink>
<NavLink className="nav-link" activeClassName="active" exact="true" to="/contact">Contact</NavLink>

        </div>
      </div>
    </nav>
  );
};

export default Navbar;
